import { Button, Input } from "antd";
import React, { useState } from "react";

const Login = () => {
    const [Email , setEmail] = useState('');
    const [Password , setPassword] = useState('');

return(
    <div>
        <div>
        <div>Login</div>
        <div>Signup</div>
        </div>
       
        <span>Email</span> <Input value={Email} onChange={(text) => {
            setEmail(text);
        }} />
        <span>Password</span> <Input value={Password} onChange={(text) => setPassword(text)} />
        <div>{Email}</div>
        <div>{Password}</div>
        <Button>Login</Button>
    </div>
)
};

export default Login;
